// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.7;

// Primeiramente so definidas as variveis e seus tipos sendo elas:
// endereo -> Coover (dona e administradora do contrato)
// inteiro -> taxa administrativa
// mapping (DHT) -> endereo de carteiras dos membros so chaves que levam ao IMEI dos celulares
// mapping (DHT) -> endereo de carteiras dos membros so chaves ao valor que possuem de reseva pessoal
contract Seguro1 {
    address payable owner;
    uint256 adminTax;
    uint256 adminTaxAmount;
    uint256 lmiTax;
    mapping(address => string) memberImei;
    mapping(address => uint256) memberFunds;
    mapping(address => bool) memberIsActive;
    //modifier para ser usado quando s o owner do contrato (Coover) pode realizar a funo
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
    //modifier para ser usado para conferir se o usurio est ativo no contrato
    modifier isActive(address _userAddress) {
        require(memberIsActive[_userAddress]);
        _;
    }

    /*Regra de negcio: A Coover  definida como dona e administradora do contrato, 
devendo estabelecer os membros deste e seus IMEIs dos aparelhos protegidos, 
assim como a taxa administrativa*/
    constructor(
        uint256 _adminTax,
        address[] memory _members,
        string[] memory _imeis,
        uint _lmiTax
    ) {
        owner = payable(msg.sender);
        adminTax = _adminTax;
        /*o loop abaixo utiliza o mapping member para conferir se a chave (address) aponta
         para o imei e fundos corretos e se os dois esto no mesmo ndice de seus respectivos arrays*/
        for (uint256 i = 0; i < _members.length; i++) {
            memberImei[_members[i]] = _imeis[i];
            memberFunds[_members[i]] = 0;
            memberIsActive[_members[i]] = false;
        }
        lmiTax = _lmiTax;
    }

    //essa funo retorna o imei do membro como string
    function realMember(address _address) public view returns (string memory) {
        return memberImei[_address];
    }

    /*Regra de negcio: os membros, no deploy do contrato, devem realizar um pagamento inicial*/
    /*a funo compara o hash do usurio que realizou a transao (msg.sender) no  distinto
    com os que esto no contrato do mapping member, para que ela se concretize*/
    function firstPayment() public payable {
        require(inverseCompare(memberImei[msg.sender], ""), "Deu ruim");
        memberFunds[msg.sender] += msg.value - ((msg.value * adminTax) / 100); //aqui  recalculado os fundos do segurado, de zero ao valor pago por ele, levando em considerao a taxa percentual administrativa subtrada do valor total pago
        adminTaxAmount += (msg.value * adminTax) / 100;
        memberIsActive[msg.sender] = true; //aps o pagamento o cliente est ativo para realizar demais funes no contrato
    }

    function inverseCompare(string memory str1, string memory str2)
        public
        pure
        returns (bool)
    {
        return
            keccak256(abi.encodePacked(str1)) !=
            keccak256(abi.encodePacked(str2));
    }

    function compare(string memory str1, string memory str2)
        public
        pure
        returns (bool)
    {
        return
            keccak256(abi.encodePacked(str1)) ==
            keccak256(abi.encodePacked(str2));
    }

    /* Regra de negcio: a Coover deve aprovar a indenizao de um segurado e, a partir disso,
     informar a carteira dele. O hash do segurado em que o sinistro ocorreu deve ser igual ao 
     que est armazenado no contrato de sua carteira para que seja concretizado*/
    function indemnity(
        address payable _userAddress,
        string memory _imei,
        uint256 _indemnity
    ) public onlyOwner isActive(_userAddress) {
        require(
            compare(memberImei[_userAddress], _imei),
            "IMEI fornecido nao corresponde"
        );
        require(memberFunds[_userAddress] * lmiTax >= _indemnity); // confere se o valor do fundo multiplicado pela taxa de limite mximo indenizvel  superior ou igual ao da indenizao requirida, ou seja, o valor total do celular
        _userAddress.transfer(_indemnity); //o mtodo utilizado aqui (transfer), s funciona com <2300, ou seja, no recomendado fazer em horrios de pico
        memberFunds[_userAddress] -= _indemnity; // recalcula o fundo do segurado
    }

    // Regra de negcio: A Coover pode retirar a taxa administrativa a qualquer momento
    function adminWithdrawal() public onlyOwner {
        owner.transfer(adminTaxAmount);
    }

    //Regra de negcio: O cliente deve conseguir ver seu valor de resera para conferir o valor protegido do seguro.
    function viewBalance() public view isActive(msg.sender) returns (uint256) {
        return memberFunds[msg.sender];
    }

    //Regra de negcio: O cliente deve conseguir repor sua reserva.
    function replaceBackup() public payable isActive(msg.sender) {
        require(inverseCompare(memberImei[msg.sender], ""), "Deu ruim");
        memberFunds[msg.sender] += msg.value;
    }
}
